import React from 'react'
import {Link} from 'react-router-dom'
import Header from '../../components/Header'

export default function DigitalZone(props) {
    return (<>
    <Header fixed/>
			<div className='container text-center mt-5'>
				<div className='flexRow sb  '>
					<div style={{ textAlign: "center" }} style={{ width: "50%" }}>
						<Link
							to='/digital_zone'
							style={{
								textDecoration: "none",
								margin: "auto",
								textAlign: "center",
							}}>
							<div
								className='categorybox'
								style={{
									display: "inline-block",
									// flexDirection: "column",
								}}>
								<img
									style={{
										width: "100px",
										height: "80px",
										borderRadius: "10px",
									}}
									src='https://cdn.mos.cms.futurecdn.net/vEcELHdn998wRTcCzqV5m9.jpg'
								/>
								<h4 style={{ margin: "auto" }}>Ticket</h4>
							</div>
						</Link>
					</div>

					<div style={{ textAlign: "center" }} style={{ width: "50%" }}>
						<Link
							to='/account/recharge'
							style={{
								textDecoration: "none",
								margin: "auto",
								textAlign: "center",
							}}>
							<div
								className='categorybox'
								style={{
									display: "inline-block",
									// flexDirection: "column",
								}}>
								<img
									style={{
										width: "100px",
										height: "80px",
										borderRadius: "10px",
									}}
									src='https://cdn.mos.cms.futurecdn.net/vEcELHdn998wRTcCzqV5m9.jpg'
								/>
								<h4 style={{ margin: "auto" }}>Mobile Recharge</h4>
							</div>
						</Link>
					</div>
				</div>
			</div>
            </>
		);
}
